// Note; lowercase L and number 1 left out, to avoid confusion.
SYSTO.cs = 'abcdefghijkmnopqrstuvwxyz023456789'.split('');

SYSTO.getUID = function () {
    var d = new Date();
    var n = d.getTime()-1395000000000;
    var UID = '';
    for (var i=7;i>=0;i--) {
        var j = Math.pow(34,i);
        var k = Math.floor(n/j);
        n -= k*j;
        UID += SYSTO.cs[k];
        if (i === 4) UID += '_';
    }
    return UID;
};



