    var node;
    var thisFun;
    var type;
    var modelChangedActions = {
        create_node:true, 
        create_arc:true,
        delete_selected:true,
        set_equation:true,
        set_node_label:true,
        load_model:true};

    // Tidy up
    //model.currentDiagram.assignLabel();
